from middlerware.handler import Handler, replace_data, MySqlHandlerWarefrom common.requset_handler import visitimport ddtimport unittestimport json# 获取车辆信息delete_car_data = Handler.excel.read_sheet("删除车辆")logger = Handler.logger@ddt.ddtclass Test(unittest.TestCase):    @classmethod    def setUpClass(cls) -> None:        cls.self_bind_carid = Handler().self_bind_carid    @ddt.data(*delete_car_data)    def test_delete_car(self, test_info):        if "#self_bind_carid#" in test_info["data"]:            test_info["data"] = test_info["data"].replace("#self_bind_carid#", str(self.self_bind_carid))        resp = visit(method=test_info["method"],                     url=Handler.host + test_info["url"],                     json=json.loads(test_info["data"]))        expected = json.loads(test_info["expected"])        self.assertTrue(expected["code"] == resp["code"])        self.assertTrue(expected["msg"] == resp["msg"])        self.db = MySqlHandlerWare()        sql = "select car_id from tb_user_managers where car_id = {}".format(self.self_bind_carid)        self.assertFalse(self.db.query(sql))        logger.info("第{}条测试用例通过".format(test_info["case_id"]))if __name__ == '__main__':    unittest.main()